import React from 'react';
import "./Navbar.css";
import logo from "./comarca-logo-ok.png"

//BOOTSTRAP
import "bootstrap/dist/css/bootstrap.min.css";

import { img } from 'react-bootstrap';

function navbar() {
    return (
        <div className="navContainer">
            <img 
                width="100"
                className="navLogo" 
                src={logo} 
                alt="comarca  de creadores logo" 
            />
            <div className="linksContainer">
                <ul>
                    <li className="linkItem">Tienda</li>
                    <li className="linkItem">Talleres</li>
                    <li className="linkItem">Nosotro</li>
                    <li className="linkItem"><button className="cartButton">Carrito</button></li>
                </ul>
            </div>
        </div>
    );
};

export default navbar;

